import React from 'react';
import {Box, Container, ThemeProvider, Typography} from "@mui/material";
import {themeOptions} from "./theme";

function App() {
    return (
        <ThemeProvider theme={themeOptions}>

                <Box
                    sx={{
                        height: "800px",
                        backgroundColor: "#FFF5DC"
                    }}>
                    <Typography variant={"h1"}>
                        JZ
                    </Typography>
                </Box>
        </ThemeProvider>

    );
}

export default App;
